import React, { Component }from 'react';

import {ContentWrap} from "./styles"


import ProjectList from "./ProjectList"
import ProjectFilters from "./ProjectFilters"


class Content extends Component{
    render() {

        return (
            
            <ContentWrap>
                 <ProjectList/>
                 <ProjectFilters/>
             </ContentWrap>
        )

    }
}

export default Content
